% Queries
restaurants_by_cuisine(CuisineType, RestaurantName) :- order(RestaurantName, CuisineType, _, _, _, _, _, _, _).
dishes_by_cuisine(CuisineType, Dishes) :- dish(CuisineType, Dishes).
all_cuisine_types(CuisineTypes) :- setof(CuisineType, Dish^dish(CuisineType, Dish), CuisineTypes).
restaurant_loc_by_cuisine(CuisineType, RestaurantName, RestaurantLocation) :- order(RestaurantName, CuisineType, _, _, _, _, RestaurantLocation, _, _).
get_dishes_info(RestaurantName,RestaurantLocation,DayOfWeek,Dishes) :- order(RestaurantName, _, _, DayOfWeek, _, _, RestaurantLocation, _, Dishes).
